import math
import random
import matplotlib.pyplot as plt
import numpy as np
import time
from urllib.request import urlopen

# Note: The Best Solution has a path length of 33523.7085074356
# Reason for local search algorithm: we do not need the information of how we got the least path cost solution, we just need to know what the least path cost solution is.

ans = [7, 28, 6, 37, 19, 27, 17, 43, 30, 36, 46, 33, 20, 47, 21, 32, 39, 48, 5, 42, 24, 10, 45, 35, 4, 26, 2, 29, 34, 41, 16, 22, 3, 23, 14, 25, 13, 11, 12, 15, 40, 9, 1, 8, 38, 31, 44, 18, 7]
ans = [i-1 for i in ans]

def plotTSP(paths, points, num_iters=1):

    """
    path: List of lists with the different orders in which the nodes are visited
    points: coordinates for the different nodes
    num_iters: number of paths that are in the path list
    """

    # Unpack the primary TSP path and transform it into a list of ordered
    # coordinates

    x = []; y = []
    for i in paths[0]:
        x.append(points[i][0])
        y.append(points[i][1])

    plt.plot(x, y, 'co')

    # Set a scale for the arrow heads (there should be a reasonable default for this, WTF?)
    a_scale = float(max(x))/float(100)

    # Draw the older paths, if provided
    if num_iters > 1:

        for i in range(1, num_iters):

            # Transform the old paths into a list of coordinates
            xi = []; yi = [];
            for j in paths[i]:
                xi.append(points[j][0])
                yi.append(points[j][1])

            plt.arrow(xi[-1], yi[-1], (xi[0] - xi[-1]), (yi[0] - yi[-1]),
                    head_width = a_scale, color = 'r',
                    length_includes_head = True, ls = 'dashed',
                    width = 0.001/float(num_iters))
            for i in range(0, len(x) - 1):
                plt.arrow(xi[i], yi[i], (xi[i+1] - xi[i]), (yi[i+1] - yi[i]),
                        head_width = a_scale, color = 'r', length_includes_head = True,
                        ls = 'dashed', width = 0.001/float(num_iters))
            plt.show()

    plt.plot(x, y, 'co')
    # Draw the primary path for the TSP problem
    plt.arrow(x[-1], y[-1], (x[0] - x[-1]), (y[0] - y[-1]), head_width = a_scale,
            color ='g', length_includes_head=True)
    for i in range(0,len(x)-1):
        plt.arrow(x[i], y[i], (x[i+1] - x[i]), (y[i+1] - y[i]), head_width = a_scale,
                color = 'g', length_includes_head = True)

    #Set axis too slitghtly larger than the set of x and y
    plt.xlim(min(x)*1.1, max(x)*1.1)
    plt.ylim(min(y)*1.1, max(y)*1.1)
    plt.show()

class SimAnneal(object):
    def __init__(self, coords, T=-1, alpha=-1, stopping_T=-1, stopping_iter=-1):
        self.coords = coords # Coordinates of the nodes
        self.N = len(coords) # Number of nodes
        self.T = math.sqrt(self.N) if T == -1 else T # Initial temperature
        self.T_save = self.T  # save inital T to reset if batch annealing is used
        self.alpha = 0.995 if alpha == -1 else alpha # Alpha is the cooling rate
        self.stopping_temperature = 1e-8 if stopping_T == -1 else stopping_T # Stop when temperature is very low
        self.stopping_iter = 100000 if stopping_iter == -1 else stopping_iter # Stop after a fixed number of iterations
        self.iteration = 1 # Iteration counter

        self.nodes = [i for i in range(self.N)] # Nodes to visit

        self.best_solution = None # Best solution found
        self.best_fitness = float("Inf") # Best fitness found
        self.fitness_list = [] # List of fitness at each iteration

    def initial_solution(self):
        """
        Greedy algorithm to get an initial solution (closest-neighbour).
        """
        cur_node = self.nodes[6]  # start from the 7th node
        solution = [cur_node] # add it to the solution

        free_nodes = set(self.nodes) # all nodes that are not yet visited
        free_nodes.remove(cur_node) # remove the starting node
        while free_nodes:
            next_node = min(free_nodes, key=lambda x: self.dist(cur_node, x))  # nearest neighbour
            free_nodes.remove(next_node) # remove from the unvisited nodes
            solution.append(next_node) # add to the solution
            cur_node = next_node # set the current node to the next node

        cur_fit = self.fitness(solution)
        if cur_fit < self.best_fitness:  # If best found so far, update best fitness and solution
            self.best_fitness = cur_fit
            self.best_solution = solution
        self.fitness_list.append(cur_fit) # Add current fitness to the fitness list
        return solution, cur_fit

    def dist(self, node_0, node_1):
        """
        Euclidean distance between two nodes.
        """
        coord_0, coord_1 = self.coords[node_0], self.coords[node_1] # Get the coordinates of the nodes
        return math.sqrt((coord_0[0] - coord_1[0]) ** 2 + (coord_0[1] - coord_1[1]) ** 2) # Calculate the euclidean distance

    def fitness(self, solution):
        """
        Total distance of the current solution path.
        """
        cur_fit = 0
        for i in range(self.N): # Loop through all nodes
            cur_fit += self.dist(solution[i % self.N], solution[(i + 1) % self.N]) # Add the distance between the current node and the next node
        return cur_fit # Return the total distance

    def p_accept(self, candidate_fitness):
        """
        Probability of accepting if the candidate is worse than current.
        Depends on the current temperature and difference between candidate and current.
        """
        return math.exp(-abs(candidate_fitness - self.cur_fitness) / self.T) # Calculate the acceptance probability

    def accept(self, candidate):
        """
        Accept with probability 1 if candidate is better than current.
        Accept with probabilty p_accept(..) if candidate is worse.
        """
        candidate_fitness = self.fitness(candidate) # Calculate the fitness of the candidate solution
        if candidate_fitness < self.cur_fitness: # If the candidate solution is better than the current solution
            self.cur_fitness, self.cur_solution = candidate_fitness, candidate # Set the current solution to the candidate solution
            if candidate_fitness < self.best_fitness: # If the candidate solution is better than the best solution found so far
                self.best_fitness, self.best_solution = candidate_fitness, candidate # Set the best solution to the candidate solution
        else: # If the candidate solution is worse than the current solution
            if random.random() < self.p_accept(candidate_fitness): # With probability p_accept(..)
                self.cur_fitness, self.cur_solution = candidate_fitness, candidate # Set the current solution to the candidate solution

    def anneal(self):
        """
        Execute simulated annealing algorithm.
        """
        # Initialize with the greedy solution.
        self.cur_solution, self.cur_fitness = self.initial_solution()

        print("Starting annealing.")
        while self.T >= self.stopping_temperature and self.iteration < self.stopping_iter: # While the temperature is above the stopping temperature and the number of iterations is below the stopping iteration
            candidate = list(self.cur_solution) # Make a copy of the current solution
            l = random.randint(2, self.N - 1) # Choose a random integer between 2 and the number of nodes - 1
            i = random.randint(0, self.N - l) # Choose a random integer between 0 and the number of nodes - l
            candidate[i : (i + l)] = reversed(candidate[i : (i + l)]) # Reverse the order of l nodes, starting from the i-th node
            self.accept(candidate) # Accept the candidate solution
            self.T *= self.alpha # Cool the system
            self.iteration += 1 # Increment the iteration counter
            self.fitness_list.append(self.cur_fitness) # Add the current fitness to the fitness list

        print("Optimal fitness for Att48: ", self.fitness(ans)) # Print the best fitness found
        print("Best fitness obtained: ", self.best_fitness) # Print the best fitness found
        improvement = 100 * (self.fitness_list[0] - self.best_fitness) / (self.fitness_list[0]) # Calculate the improvement
        print(f"Improvement over greedy heuristic: {improvement : .2f}%") # Print the improvement

    def batch_anneal(self, times=10):
        """
        Execute simulated annealing algorithm `times` times, with random initial solutions.
        """
        for i in range(1, times + 1):
            print(f"Iteration {i}/{times} -------------------------------") # Print the iteration number
            self.T = self.T_save # Reset the temperature
            self.iteration = 1 # Reset the iteration counter
            self.cur_solution, self.cur_fitness = self.initial_solution() # Get a new initial solution
            self.anneal() # Execute the annealing algorithm

    def visualize_routes(self):
        """
        Visualize the TSP route with matplotlib.
        """
        plotTSP([self.best_solution, ans], self.coords, 2) # Plot the best solution found and the optimal solution

    def plot_learning(self):
        """
        Plot the fitness through iterations.
        """
        plt.plot([i for i in range(len(self.fitness_list))], self.fitness_list) # Plot the fitness list
        plt.ylabel("Fitness") # Set the y-axis label
        plt.xlabel("Iteration") # Set the x-axis label
        plt.show() # Show the plot

def read_coords(path):
    """
    Read coordinates from a file.
    """
    with urlopen(path) as f: # Open the file
        coords = [tuple(map(float, i.split())) for i in f.read().splitlines()] # Read the coordinates
    return coords # Return the coordinates



if __name__ == "__main__":
    coords = read_coords("https://people.sc.fsu.edu/~jburkardt/datasets/tsp/att48_xy.txt") # Read the coordinates from the file att48_xy.txt 
    sa = SimAnneal(coords, T=-1, alpha=0.995, stopping_T=-1, stopping_iter=5000) # Create a SimAnneal object with the coordinates and a stopping iteration of 50000 iterations
    start = time.time() # Get the current time
    sa.anneal()
    end = time.time() # Get the current time
    print(f"Time elapsed: {end - start : .5f}s") # Print the time elapsed
    sa.visualize_routes()
    sa.plot_learning()

